import React from 'react';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import Link from '@material-ui/core/Link';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';

import { withStyles } from '@material-ui/core/styles';

import CopyRight from './../components/CopyRight'

import {fetch as fetchPolyfill} from 'whatwg-fetch'

const style ={
  paper: {
    marginTop: "30px",
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: "2px",
    backgroundColor: "#fff",
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: "2px",
  },
  submit: {
    margin: "8px",
    height:"50px"

  },
  title:{
      fontSize:"36px",
      color:"#64b5f6"
  },
  verifyCodeDiv:{
    height:"50px"
  }
  ,
  verifyCode:{
    cursor:"pointer",
    position:"relative",
    right:"-35%",
    bottom:"53px",
    margin:"2px 9px",
    textAlign:"left"

  }
};



function veryfyCode(options){
  console.log(options);
}

/**
 * 我们的登陆的基本操作
 */
class LoginMod extends React.Component{
  constructor(props){
    super(props)
    this.state={
      src: this.props.src ? this.props.src : ''
    }
    this.verifyCodeFun=this.verifyCodeFun.bind(this)
  }

  componentDidMount(){
    const _this=this;
    window.fetch("http://api.breakpoint.vip/block/v1/image/getVerifyCode").then(function(response){
      return response.json()
  }).then(function(json) {
    _this.setState({
        src: json.data.verifyCode
    })
    });
  }

  verifyCodeFun = function (param) { 
    return "aaa"
   };
  render(){
    const {classes} = this.props;

    let {src} = this.state;

    return(
<Container component="main" maxWidth="xs">
      <CssBaseline />
      <div className={classes.paper}>
      <div className={classes.title}>光网络规划系统</div>
        {/* <Avatar className={classes.avatar}>
          <LockOutlinedIcon />
        </Avatar> */}
        {/* <Typography component="h1" variant="h5">
          Sign in
        </Typography> */}
        <form className={classes.form} noValidate>
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="email"
            label="username"
            name="username"
            autoComplete="username"
            autoFocus
          />
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            name="password"
            label="Password"
            type="password"
            id="password"
            autoComplete="current-password"
          />
          <div>
          <TextField id="verifyCode"
           label="验证码"
           required
           fullWidth
            variant="outlined" />
          <img id="" src={src} className={classes.verifyCode}/>
          </div>

          {/* <FormControlLabel
            control={<Checkbox value="remember" color="primary" />}
            label="Remember me"
          /> */}
          <Button
            type="submit"
            fullWidth
            variant="contained"
            color="primary"
            className={classes.submit}
          >
            登陆
          </Button>
          <Grid container>
            <Grid item xs>
              <Link href="#" variant="body2">
                Forgot password?
              </Link>
            </Grid>
            <Grid item>
              <Link href="#" variant="body2">
                {"Don't have an account? Sign Up"}
              </Link>
            </Grid>
          </Grid>
        </form>
      </div>
      <Box mt={8}>
        <CopyRight />
      </Box>
    </Container>
    )
  }
}

export default withStyles(style)(LoginMod);





